import * as helaperApi from "../Api/helperApis.js";

export const addNewTeam = async (NewTeamName) => {
  console.log("datadatadatadata");
  try {
    const data = await helaperApi.createNewTeam(NewTeamName);

    return data;
  } catch (err) {
    console.log(err);
  }




  var data = JSON.stringify({
    Name: NewTeamName,
  });
  var config = {
    method: "post",
    url: "http://cms.avertra.com/teams",
    headers: {
      Authorization: "Bearer " + store.getState().token,
      "Content-Type": "application/json",
    },
    data: data,
  };

  axios(config)
    .then((response) => {
      console.log(response.data, "REsponse Data from create New Team");
      localStorage.setItem("newTeam", JSON.stringify(response.data));
      return response.data;
    })
    .catch((error) => {
      console.log(error);
    });
};
